import React, { Component } from 'react';
import navbar from './Navbar.css';

class Navbar extends Component {
    render(){
        return(
             menuitems = [
                {
                   label:'Home',
                   icon:'pi pi-fw pi-home'
                },
                {
                   label:'Sobre',
                   icon:'pi pi-fw pi-user',
                },
                {
                   label:'Contato',
                   icon:'pi pi-fw pi-comment'
                }
             ]
        
          )
    }
    
}
export default Navbar;
